import React from "react";
import "./Resume.css";

function Resume() {
  return (
    <div className="all">
      <h1 className="header">פריאל חזן</h1>
      <img src="images/PrielHazanResume.jpg" alt="Priel Hazan Resume" />
    </div>
  );
}

export default Resume;
